import React, { Component } from 'react'
import UserItem from './UserItem'

class Users extends Component {

    render() {
        return (

            <div style={{
                display: 'grid',
                gridTemplateColoumns: 'repeat(3,1fr)',
                gridGap: '1rem'
            }}>
                {this.props.users.map(user => (
                    <UserItem key={user.id} user={user} />
                ))}

            </div>
        );

    }
}
const userStyle = {
    display: 'grid',
    gridTemplateColoumns: 'repeat(3,1fr)',
    gridGap: '1rem'
}
export default Users;
